import React,{useEffect} from 'react'
import Navbar from '../Navbar/Navbar'
import {useSelector ,useDispatch } from 'react-redux';
import { FetchImage } from '../../state/slicer.js';


export default function ImageGallary() {
    const dispatch=useDispatch();
    const ImageGallary=useSelector((state)=>state?.image?.ImageGallary)
    console.log("images===",ImageGallary)

    useEffect(() => {
        dispatch(FetchImage());
        console.log("ImageGallary===",ImageGallary)
    }, [dispatch]);

  return (
    <>
      <Navbar/>
      <table>
            <thead>
                <tr>
                    <th>Image</th>
                    <th>Title</th>
                    <th>Description</th>
                    <th>Views</th>
                </tr>
            </thead>
            <tbody>
                {ImageGallary&&ImageGallary.map(image => (
                    <tr key={image._id} >
                        <td><img src={image.url} alt={image.title} style={{ width: '100px' }} /></td>
                        <td>{image.title}</td>
                        <td>{image.description}</td>
                        <td>{image.views}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    </>
  )
}
